(1, 'Recuerden que deben actualizar los precios del Brok 11', 'Si tienes alguna duda, consulta a tu Coordinador para que te oriente!', '14/02/2022', 'General', '1', 'si'),
(2, 'Nueva actualización de CRM! - Avisos y Citas', 'En esta actualización se añadio \"Avisos\", encontraras en esta sección Aviso Generales, Avisos de tu Coordinador y Avisos de Sistema!.\nTambien el \"Calendario de Citas\", se añadieron Leyendas para identificar más rápido el tipo de cita que esta registrada, de igual forma se añadio la hora de la cita, ayudara a identificar y filtrar citas más preciso.\nAhora tambien visualizaras el mes actual, y el mes siguiente, esto ayudara a ver tus citas con anticipación.\nPodras ver más información de algunos y de otros no, ya que suelen ser avisos muy cortos.\n', '14/02/2022', 'Sistema', '1', 'si'),
(3, 'Actualización CRM - Nuevo apartado \"¡Ayuda!\".', 'Hola!, ¿Has tenido problemas con algún tema en especifico?, bueno el apartado Ayuda, esta para solucionar esos problemas, en este apartado encontraras, tutoriales que te iran guiando paso a paso.\r\nActualmente solo esta lo básico, si tienes alguna sugerencia, es bien recibida!.\r\n', '14/02/2022', 'Sistema', '1', 'si'),
(4, 'Actualización CRM - Tickets de ayuda!, Edición de Citas, Avisos por coordinador y Generales, Sección \'Mis Tickets\'.', 'Bienvenidos a la versión 1.12! |\n| Tickets de ayuda!:\nSe abrieron los tickets de ayuda, estos serviran para informar errores, sugerencias, cambios y más en el sistema o en general, alguna solicitud; Podras visualizar en \'Mis Tickets\' la información de tu ticket, el estatus y el seguimiento.\n| Edición de citas:\nAhora ya es momento de agregar el seguimiento a tus citas y cambiar el estatus de estas, actualiza tus citas!.\n| Avisos por Coordinador y Generales:\nGerencia y Coordinadores, ya es hora de agregar sus avisos, para que su equipo este al tanto de todo lo que se debe tener en cuenta, solo agrega la información que quieras que se entere tu equipo o general y asi manten a tu equipo actualizado.', '18/02/2022 11:19 am', 'Sistema', '1', 'si'),
(5, 'Cambio de equipos! Presentarse para actualización', 'Hola asesores y/o coordinadores que recientemente han sido movidos de grupo, es necesario que se presenten a la oficina para realizar la actualización de correo institucional; usuario y contraseña de CRM.\r\nGracias!', '18/02/2022 11:53 am', 'General', '1', 'si'),
(6, 'Solicitud de Tickets por Correo Electronico', 'Para enviar una solicitud de ticket (ayuda) por correo electronico, se debera llevar los siguientes campos.\r\nAsunto: Debe contener \"Alta Solicitud (Ticket) -\", acontinuación de eso deberá llevar su número de grupo y nombre para identificarlo.\r\nEn el contenido del correo, podra llevar imagen(es), texto, que describa en detalle su problema, su posible solución, su sugerencia, o duda.\r\n\r\nDe lo contrario de no contener el asunto correcto, el correo no sera posible leerlo, y a su problema no darle una solución.', '18/02/2022 04:51 pm', 'Sistema', '1', 'si'),
(7, 'No es necesario enviar citas por Correo Electronico', 'Hola!, con la nueva actualización del CRM, ya no es necesario que cuando realizes un alta de cita, mandes correo a meganh@agnor.... el sistema lo hara automaticamente.\r\nSaludos!', '18/02/2022 05:50 pm', 'General', '1', 'si'),
(8, '¿Usuario y contraseña de Inmuebles, Vivanuncios?', 'Ya no es necesario solicitar manualmente tu usuario y contraseña de las plataformas, ahora solo necesitas ir a \'Mi cuenta\', y pasar el mouse sobre las contraseñas para visualizarla.\r\nCualquier duda, dar de alta un ticket de ayuda para solucionarlo en breve!\r\nSaludos!', '18/02/2022 05:52 pm', 'General', '1', 'si'),
(9, 'Actualización CRM v1.13 | Calendario Citas, mejoras y más', 'En esta nueva actualización se han ajustado los tickets de ayuda, se ha mejorado la rapidez de la página para mejor eficiencia.\r\nCalendario de citas ahora podras dar clic en las leyendas para filtrar las citas, por las que tengan seguimiento o les falte seguimiento.\r\nLos avisos generales solo estarán disponibles una semana en \'Mi Panel\', despues solo estarán disponibles en \'Avisos\'.\r\nPor el momento queda deshabilitado el acceso rápido de \'Google Drive\', hasta nuevo aviso.', '21/02/2022 11:29 am', 'Sistema', '1', 'si'),
(11, 'Curso manejo de objeciones y cierres de ventas', 'Equipo buenas tardes hoy 23 de febrero tenemos curso a las 16.00hrs. no falten por favor será impartido por Adalberto y una servidora', '23/02/2022 01:05 pm', 'Coordinador', '300', 'si'),
(12, 'Estimados compañeros AG NOR', 'El mes de Febrero para las personas que saben lo que quieren, fue un mes de mucho esfuerzo y muy poco resultado, ANIMO, TODO lo que se siembra en la vida se recibe MULTIPLICADO para bien o para mal, las leyes universales nunca fallan y TU SABES realmente cual fué tu siembra el mes pasado. Los invito a que se sigan esforzando, la META DE MARZO es de 2 VENTAS por asesor ya que hay que reponer la venta del mes de Febrero. Este mes van a recibir los frutos de lo hecho en Febrero, más sus 15 publicaciones SEMANALES sin falla estoy seguro que los resultados serán satisfactorios. En el caso de Remates Bancarios, por instrucciones de la Dirección General y nuestra área Legal, favor de realizar FICHAS UNICAMENTE de los siguientes lugares: -CDMX -Estado de México incluyendo Toluca -Acapulco -Puebla -Querétaro -Veracruz -Toluca -Monterrey Del estado de Morelos, únicamente... -Cuernavaca (con alberca de preferencia) -Jiutepec Les deseo TODO el éxito del mundo, SI SE PUEDE.', '01/03/2022 06:06 pm', 'General', '1', 'si'),
(13, 'Foto de perfil para CRM y otros servicios', 'Buena tarde!.\nPara una experiencia mas agradable en el CRM, se incluiran las fotos de perfil para CRM.\nLo encontraran en la sección de \'Mi cuenta\', el icono se cambiara por su Foto.\nAyudara a los Asesores a encontrar rapidamente el apartado, y a los Coordinadores a identificar a su equipo con su foto.\nPara esto es importante que todo el personal envie su mejor foto, al correo sistemas@agnorconsultores.com.\nPonganse guapos ????\nSaludos!', '11/03/2022 04:27 pm', 'Sistema', '1', 'si'),
(14, 'Cambio de Correos Gmail a Institucionales', 'Compañeros, el cambio de cuentas gmail personales o con algun \'.agnor@gmail.com\', estarán proximamente fuera del regimen de trabajo.\nPara esto se encuentra un tutorial nuevo en el apartado \'Ayuda\', para realizar el alta de su cuenta gmail con el correo institucional, esto ayudara a tener mejor control con su drive y asi unificar las cuentas institucionales.\nSi tiene archivos en su cuenta gmail anterior, realizar las trasnferencias a su cuenta nueva.\nSaludos!', '11/03/2022 05:48 pm', 'General', '1', 'si'),
(15, 'Tickets de ayuda', 'Recuerda que si tienes dudas, sugerencias, o problemas con el CRM.\r\nEnvia un ticket de ayuda desde el apartado \'Ayuda\'.\r\nSi las sugerencias,dudas, o problemas, no son enviados desde correo o desde el CRM, no sera posible dar seguimiento, por lo que no se implementara, solucionara, los problemas.\r\nSaludos!', '14/03/2022 04:59 pm', 'General', '1', 'si'),
(16, 'Cambios en CRM Proximamente', 'Hola equipo, el sistema CRM\r\nTendra algunos cambios dentro de los siguientes dias.\r\nEstate atento a los cambios ya que facilitarán algunas actividades, y trae consigo grandes y pequeños cambios.\r\nSaludos!', '17/03/2022 03:47 pm', 'General', '1', 'si'),
(18, 'Versión 1.16 del CRM, ya esta aquí, pruebalo!', 'Se han añadido estas caracteristicas:\r\n1.	Nuevo menú Ajustes, esto ayudara a personalizar el CRM al gusto de cada asesor, así como saber que paginas desea ver y que no.\r\n2.	Nuevo menú lateral de navegación, ayudara a mantener una mejor organización en páginas, se puede configurar en ajustes, si desea mantener el actual o el anterior menú.\r\n3.	En la barra de menú lateral, la imagen de perfil, será el acceso a Mi cuenta\r\n4.	Se han cambiado los iconos a imágenes, para mejor identificación\r\n5.	Nuevas personalizaciones, Se puede personalizar el color que gustes para que tu CRM tenga mejor presentación y un estilo propio.\r\n6.	¡Ahora se ha cambiado el icono de Mi cuenta, por una foto tuya!\r\n7.	Para Coordinadores, ahora podrán escoger entre modo Asesor, para ver sus clientes, sus citas, sus estadísticas, y más, ten en cuenta que algunas opciones no estarán disponibles en el modo Asesor.\r\n8.	Tarjetas de presentación en el menú Usuarios y buscador por nombre y apellidos, esto ayudara a encontrar rápidamente usuario para verificar acceso, correo de plataformas.\r\n9.	Clientes el orden al buscar ahora será igual que el que aparecen, se intercambiaba a la hora de buscar\r\n10.	Al buscar clientes por número telefónico, era posible buscar con espacios, lo cual provocaba que los registros no aparecieran, ahora se bloqueó la función para solo buscar con el formato correcto a 10 dígitos\r\n11.	Más tipos de solicitud en Tickets de ayuda, pedir ayuda será más fácil, y así tener una respuesta más rápida, dependiendo de tu solicitud.\r\n12.	Más graficas en Mi panel, se ha ajustado las gráficas existentes, y se han añadido, las siguientes:\r\nMedio de contacto, Estados de las citas, Formas de pago, Tipos de avisos y estos serán desactivables en el apartado de Ajustes\r\n13.	Nuevos tutoriales, se incluyeron los tutoriales como: Dar de alta cuenta Gmail con correo institucional, Dar de alta mis Registros de publicaciones, Como dar de alta un Ticket, Agregar seguimiento a Clientes, agregar seguimiento a Citas, Editar campos de Clientes.\r\n14.	Se agregaron más tipos de crédito para escoger, si el cliente tiene un crédito que no está en la lista, envía un ticket para añadirlo y perder el seguimiento correcto.\r\n15.	Se añadieron más iconos para identificar más rápido las acciones que desea tomar; por ejemplo, el ojo el cliente, para ver, el teléfono para llamar directamente, el lápiz para editar el cliente, etc.\r\n16.	Se añade el registro automáticamente cuando das de alta un cliente, se añade un registro cuando das de alta una cita a algún cliente, y cuando se añade el registro, así como añadir registro cuando se edita el contenido del cliente.\r\n17.	Al dar de alta un cliente, te mostrará opciones para Ir al cliente, Dar de alta una cita o solo ir al apartado de Clientes\r\n18.	Se presenta el apartado de Metas, añadido en Mi cuenta, para los registros de publicaciones de propiedades, así como su verificación de estos, tiene una barra de progreso, la cual calculará las publicaciones registradas con el total, así mostrando una imagen animada dependiendo del progreso que lleve el asesor y/o coordinador\r\n19.	Se añaden nuevos sonidos para distintos accesos, inicio de sesión, publicaciones, alta cliente, alta cita, finalizo la meta de publicaciones, edición de registros, etc.\r\n20.	Animaciones en diferentes apartados, esto ayudara a dar vida al CRM y ver claramente notificaciones u otras notificaciones\r\n21.	Inicio de sesión, se encuentra un ‘ojo’ como icono para visualizar la contraseña, esto ayudara a verificar si la contraseña escrita es la correcta.\r\n22.	Al iniciar sesión ahora te llevará a tu perfil, que anteriormente era a ‘Mi panel’.\r\n', '17/03/2022 05:42 pm', 'Sistema', '1', 'si'),
