(339, 'Notificación CRM - Prospectos - 30/03/2022 05:00:21 pm', 'Se le ha asignado un Prospecto a Maria Teresa Martinez Guzman G: 205!  <a href=\"dashboard_cliente.php?id=765#registros\"> Ver </a>', '30/03/2022 05:00 pm', 'Notificación', '200 ', 'si_200 '),
(340, 'Versión 1.17 CRM', '1.	Se añadió en el apartado de Avisos icono de ‘Visto’, esto ayudara a que las notificaciones del CRM puedan ser leídas desde ese apartado.\n2.	Se añadió el apartado de filtros en la sección ‘Clientes’, esto ayudara a visualizar la información que se necesita para cada usuario, esto se guarda en sus preferencias del usuario, este cambiara de color según tus ajustes.\n3.	Cuando los avisos estén en 0, el icono desaparecerá, y cuando tenga alguna notificación saltará hasta que haya sido leído.\n4.	Se han ajustado los permisos de Coordinador y Asesor para los diferentes modos del CRM\n5.	Se presenta el modulo ‘Mi equipo’, en esta sección visualizaras a los integrantes de tu equipo/grupo, veras su nombre, grupo, correo y teléfono; podrás llamarlos directamente o enviarles un correo tan solo dando clic en sus respectivos contactos.\n6.	Las notificaciones de asignaciones de clientes, aparte de notificar al asesor, notificarán a su coordinador\n7.	Se siguen actualizando ajustes de modo ‘Asesor’, tomar en cuenta que sigue en beta, puede presentar errores aún.\n8.	Debido a varios casos de errores, en donde el usuario guardaba un acceso directo al CRM, este al no iniciar sesión por seguridad (implementada en la versión 1.16), automáticamente no mostraba información, ahora re direcciona automáticamente al inicio de sesión y así evitar que el usuario salga del CRM pensando que este no esta disponible. \n9.	Se ha hecho un gran cambio a los iconos, estos tendrán una apariencia mejorada, ya que los anteriores eran planos, ahora se han mostrado para una mejor visualización.\n10.	Se ha añadido el registro en citas, ahora podrás añadir comentarios sobre cada cita, y contestar a comentarios que hayan sido escritos por otros usuarios\n11.	Notificaciones mejoradas, ahora se ha arreglado el error que, si algún usuario leía una notificación, a los demás usuarios ya no se visualiza como pendiente.\n12.	Se solucionó un error, en donde el usuario al entrar desde un acceso directo al CRM, este le mostraba una página de error y no lo dejaba continuar.\n13.	Nuevo inicio de sesión inteligente, vuelve a tu sesión con un solo clic, al activar la casilla de ‘Mantener Sesión’ dentro del inicio de sesión, el CRM mantendrá activa tu sesión sin importar a donde hayas ido o cuánto tiempo estuviste fuera.\n\n', '30/03/2022 05:40 pm', 'Sistema', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 103 104 106 107 108 109 110 200 201 202 203 204 205 206 207 208 209 210 211 212 213 300 301 302 303 304 305 306 400 401 402 403 404 405 406 407 408 409 410 411 412 500 501 502 503 600 800 801 803 804 805 ', 'si_1 si_2 no_3 si_4 si_5 no_6 si_7 no_8 no_50 no_51 no_52 no_53 no_54 si_100 si_101 si_102 no_103 no_104 si_106 no_107 no_108 si_109 si_110 si_200 no_201 no_202 no_203 si_204 si_205 si_206 no_207 no_208 no_209 no_210 no_211 no_212 si_213 si_300 si_301 no_302 si_303 no_304 si_305 no_306 si_400 si_401 no_402 no_403 si_404 si_405 no_406 no_407 no_408 no_409 si_410 no_411 si_412 si_500 no_501 si_502 no_503 no_600 si_800 no_801 no_803 no_804 si_805 '),
