(763, 'Aviso Coordinadores', 'Si tienen algún usuario que tengan que dar de baja del sistema.\r\nEn Ayuda, realizen su ticket para dar de baja a los usuario que indiquen y especificar el porque se dara de baja, ademas de comentar que pasara con los clientes/prospectos que hayan dado de alta.\r\nPueden reasignarselo a ustedes o algún otro usuario.\r\n\r\nSaludos', '20/04/2022 04:02 pm', 'General', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 103 104 106 107 108 109 110 112 200 201 202 204 205 206 207 208 209 210 211 212 213 214 300 301 302 303 304 305 306 307 400 401 402 403 404 405 406 407 408 409 410 411 412 413 500 501 502 503 504 600 800 801 802 803 804 805 ', 'si_1 no_2 no_3 si_4 si_5 si_6 no_7 no_8 no_50 no_51 no_52 no_53 no_54 si_100 si_101 si_102 no_103 no_104 si_106 no_107 no_108 si_109 si_110 si_112 no_200 no_201 no_202 si_204 si_205 si_206 no_207 no_208 no_209 no_210 no_211 no_212 no_213 no_214 si_300 si_301 no_302 si_303 no_304 no_305 no_306 si_307 si_400 si_401 no_402 no_403 si_404 si_405 no_406 no_407 no_408 no_409 no_410 no_411 si_412 no_413 no_500 no_501 si_502 no_503 no_504 no_600 si_800 no_801 no_802 no_803 no_804 no_805 '),
(764, 'Aviso Actualización CRM 1.18', 'Se programara la actualización del CRM 1.18, para el dia 22/abril/2022 a las 5:00pm.\r\nPor lo que no estará disponible durante aproximadamente 1 hora.\r\nTomen sus precauciones.\r\n¡Saludos!\r\n', '22/04/2022 11:37 am', 'General', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 104 106 107 108 109 110 112 200 201 202 204 205 206 207 208 209 210 211 212 213 214 300 301 302 303 304 305 306 307 400 401 402 403 404 405 406 407 408 409 410 411 412 413 500 501 502 503 504 600 800 801 802 803 804 805 ', 'si_1 no_2 no_3 si_4 si_5 si_6 no_7 no_8 no_50 no_51 no_52 no_53 no_54 si_100 si_101 si_102 no_104 si_106 no_107 no_108 si_109 si_110 si_112 si_200 no_201 no_202 si_204 si_205 si_206 no_207 no_208 no_209 no_210 no_211 no_212 no_213 no_214 si_300 no_301 no_302 si_303 no_304 no_305 no_306 si_307 si_400 si_401 no_402 no_403 si_404 si_405 no_406 no_407 no_408 no_409 no_410 no_411 si_412 no_413 no_500 no_501 si_502 no_503 no_504 no_600 si_800 no_801 no_802 no_803 no_804 no_805 '),
(765, 'CRM actualización 1.18 - Mantenimiento', 'El servidor quedara en mantenimiento para actualizar el CRM a 1.18.\r\nQuedará inactivo 1 hora aproximadamente, aun asi, se enviara un correo electronico, avisando que el CRM, se encuentra en funcionamiento de nuevo.\r\nEl mantenimiento se estima que inicie el dia 26/abril/2022 a las 3:30pm\r\n\r\nSaludos', '26/04/2022 01:30 pm', 'General', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 104 106 107 108 109 110 112 200 201 202 204 205 206 207 208 209 210 211 212 213 214 300 301 302 303 304 305 306 307 400 401 402 403 404 405 406 407 408 409 410 411 412 413 500 501 502 503 504 600 800 801 802 803 804 805 806 ', 'si_1 no_2 no_3 no_4 si_5 no_6 no_7 no_8 no_50 no_51 no_52 no_53 no_54 no_100 no_101 si_102 no_104 no_106 no_107 no_108 no_109 no_110 si_112 no_200 no_201 no_202 no_204 no_205 si_206 no_207 no_208 no_209 no_210 no_211 no_212 no_213 no_214 si_300 no_301 no_302 no_303 no_304 no_305 no_306 si_307 no_400 no_401 no_402 no_403 si_404 no_405 no_406 no_407 no_408 no_409 no_410 no_411 no_412 no_413 no_500 no_501 no_502 no_503 no_504 no_600 no_800 no_801 no_802 no_803 no_804 no_805 no_806 '),
