INSERT INTO `avisos` (`id`, `titulo`, `descripcion`, `fecharegistro`, `tipo`, `grupo`, `leido`) VALUES
(767, 'CRM 1.18', 'CRM 1.18\r\n1.	Se ha agregado graficas al apartado Registro de publicaciones, estas son:\r\na.	Publicaciones totales por grupo: Esta grafica mostrara las publicaciones por cada asesor, si es coordinador; de su grupo. (si se encuentra en modo ‘Asesor’, se visualizará solo sus publicaciones)\r\nb.	Totales por inmuebles24: Esta grafica mostrara las publicaciones de inmuebles24\r\nc.	Totales por Facebook: Esta grafica mostrara las publicaciones de Facebook\r\nd.	Esta grafica mostrara las publicaciones de Vivanuncios\r\n2.	Para Coordinadores, el CRM mandara una notificación si están pendientes publicaciones por revisar.\r\n3.	Se agregó sistema de verificación de publicaciones, estas serán verificadas por el Coordinador de tu grupo, si no se verifica o tiene algún error se añadirá el motivo por el cual está mal la información que colocaste, los puntos a verificar son:\r\na.	La publicación tenga link (dirección URL) correcto\r\nb.	La publicación proporcione la línea de negocio correcta\r\nc.	Nota: si el Coordinador no verifica tu publicación, esta no contara para tu meta mensual.\r\n4.	Se han cambiado los iconos y aún más se han añadido.\r\n5.	Nuevos ajustes al Sistema de menú, actualizado y mejorado\r\na.	Podrás ocultar o mostrar iconos que consideres, estos se ajustarán a un menú padre o se ocultarán, así será más fácil reconocer las categorías y acceder más rápido a las funciones.\r\n6.	Nuevo apartado ‘Ventas’ (Solo disponible en la información del cliente): registra las ventas que has tenido de tus clientes, si te han depositado, y añade datos como, RFC, NSS, si es persona Física o Moral y el motivo por el cual te han realizado ese pago.\r\n7.	Han regresado los iconos de ventas a tus clientes, visualiza la información con la que has proporcionado y ten un control más amplio\r\n8.	Se solucionó un error en la información del cliente, mostraba el tipo de anuncio sobre puesto con otros datos, añadiendo así de igual forma separadores, para visualizar la información más sencillo\r\n9.	Se ha agregado a Citas más campos para identificar más fácil a qué lugar realizaras tu propiedad estos son:\r\na.	Estado y Municipio/delegación: Mostrará las opciones dependiendo de qué estado selecciones, esto identificará el lugar donde tienes la cita.\r\nb.	Apoyo Coordinador, Jurídico, Llaves: Ayudará a apartar la fecha junto con la ayuda que necesitas, y avisará a los respectivos campos que selecciones, ejemplo: si seleccionas Coordinador, le llegará una notificación que estas solicitando su ayuda, si necesitas ayuda de otro coordinador especificarlo.\r\nc.	Las fechas en la que se puede realizar una cita cambio, solo es posible realizar una cita 24 horas con anticipación.\r\n10.	En la sección Clientes, se han hechos cambios de selección en cuanto Línea de negocio, Estado del cliente y Grupos, ahora es más sencillo seleccionarlo desde una lista de opciones, así no tendrás que escribirlos.\r\n11.	La manera de visualizar las citas ha cambiado su estilo, y es más sencillo encontrar los datos.\r\n12.	La manera de visualizar los clientes ha cambiado su estilo, es más practico encontrar los datos.\r\n13.	Al visualizar el cliente, se podrá añadir más rápido ahora los seguimientos, notas, etc., que quieras añadir\r\n14.	La barra de navegación se ha hecho más pequeña, así tendrás mas visión de la información y se ha ajustado a versión móvil para no perder nada.\r\n15.	Icono de notificaciones han cambiado, ahora son de tamaño regular.\r\n16.	Ahora es necesario que los números telefónicos de celular y casa sean capturados para evitar que el sistema los tome como duplicado.\r\n17.	En el icono ‘Avisos’ al pasar el cursor, este mostrará las notificaciones que no has leído de CRM, Coordinador y/o Generales; además podrás leerlas desde ahí.\r\n18.	En registro de publicaciones Links, se ha añadido una opción para dar motivo si esta, presenta alguna falla o si faltan datos en su publicación y mostrara la fecha en que se hizo la última modificación; además se añadió un botón de eliminar (Solo para Coordinadores) para eliminar completamente la publicación, si esta es considerada un fallo o no es funcional.\r\n19.	Sabana Jurídica (Solo Abogados) es un nuevo apartado para subir expedientes y adjuntar archivos necesarios para ellos.\r\n20.	Apartado ‘Mi cuenta’ ha cambiado por tu nombre ejemplo ‘Juan’\r\n21.	Ya es posible cambiar tu foto de perfil o subirla desde cualquier lugar y momento (solo se aceptan imágenes en .jpg y .png).\r\n22.	Es posible cambiar la imagen de portada, para darle un estilo más personalizado a tu CRM.\r\n23.	En Citas, se ha eliminado el botón ‘Editar’, ahora se añade el seguimiento directamente en la cita.\r\n24.	Ahora en Clientes es posible añadir una cita nueva o una venta, desde el mismo apartado sin tener que redirigirse a otras páginas, solo da clic en el botón correspondiente para rellenar el formulario.\r\n25.	Ahora en el inicio de sesión puedes solicitar tus datos de acceso, estos llegarán a tu correo registrado, en poco tiempo, si no llega, revisa tu bandeja de SPAM.\r\n26.	A cambiado aspectos generales del CRM\r\n', '26/04/2022 03:55 pm', 'Sistema', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 104 106 107 108 109 110 112 200 201 202 204 205 206 207 208 209 210 211 212 213 214 300 301 302 303 304 305 306 307 400 401 402 403 404 405 406 407 408 409 410 411 412 413 500 501 502 503 504 600 800 801 802 803 804 805 806 ', 'si_1 no_2 no_3 si_4 si_5 no_6 si_7 no_8 no_50 no_51 no_52 no_53 no_54 si_100 si_101 si_102 no_104 si_106 no_107 no_108 si_109 no_110 si_112 no_200 no_201 no_202 si_204 si_205 si_206 no_207 no_208 no_209 no_210 no_211 no_212 no_213 no_214 si_300 no_301 no_302 si_303 no_304 no_305 no_306 si_307 si_400 si_401 no_402 no_403 si_404 no_405 no_406 no_407 no_408 no_409 si_410 no_411 si_412 no_413 si_500 no_501 no_502 no_503 no_504 no_600 si_800 no_801 si_802 no_803 no_804 si_805 no_806 '),
