(781, 'Atención - Urgente', 'Debido que se han reportado varios errores respecto a alta de usuarios.\r\nEste error indica que la información se ha ingresado erroneamente y regresa al listado de clientes.\r\nEsto suele suceder cuando el sistema detecta un duplicado de datos, para evitar esta situación.\r\nEl número Celular proporcionado debe ingresarse en número Casa/Local.\r\n\r\nCualquier duda, reportalo en ayuda.\r\nSaludos a todos!', '28/04/2022 11:13 am', 'General', '1 2 3 4 5 6 7 8 50 51 52 53 54 100 101 102 104 106 107 108 109 110 112 200 201 202 204 205 206 207 208 209 210 211 212 213 214 300 301 302 303 304 305 306 307 308 400 401 402 403 404 405 406 407 408 409 410 411 412 413 500 501 502 503 504 600 800 801 802 803 804 805 806 ', 'si_1 no_2 no_3 no_4 no_5 no_6 no_7 no_8 no_50 no_51 no_52 no_53 no_54 no_100 no_101 no_102 no_104 no_106 no_107 no_108 no_109 no_110 no_112 no_200 no_201 no_202 no_204 no_205 no_206 no_207 no_208 no_209 no_210 no_211 no_212 no_213 no_214 no_300 no_301 no_302 no_303 no_304 no_305 no_306 no_307 no_308 no_400 no_401 no_402 no_403 no_404 no_405 no_406 no_407 no_408 no_409 no_410 no_411 no_412 no_413 no_500 no_501 no_502 no_503 no_504 no_600 no_800 no_801 no_802 no_803 no_804 no_805 no_806 '),
