(1, 5, 'Cita Proyecto GP 9 |  Coahuila, Roma Norte', 'Solicita ver los Departamentos Coahuila, Roma Norte, GP 9,su acompañante es: Benjamín López, Se le menciona que Adalberto J. la contactara para enviarle la ubicación, así como el recorrido en el proyecto. ', 'Domingo 16 de Enero del 2022 11:00 am', 'Incompleto', 2, '13-01-2022', ' ', 'Mayra Diaz', '', '', ''),
(2, 4, 'Cita Virtual | Zoom | Lago Winnipeg ', 'Se le menciona que ya es una propiedad de entrega Inmediata, pero le asusta que pueda ser de remate bancario, porque lo vio en anuncio, trae $1,600,000.00 se reserva cita virtual para que le expliquen bien como se realizaría y después hacer la visita a la propiedad. Se reviso con Yair y se se acepta el monto que trae, la visita presencial puede ser para el sábado solo definir el horario. \r\nHoy platicara con su esposo y quiere un Zoom para el 14 de Enero a las 20:00hrs.  ', 'Viernes 14 de Enero del 2022 08:00 pm', 'Incompleto', 2, '13-01-2022', '', 'Mayra Diaz', '', '', ''),
(3, 7, 'Cita Virtual | Zoom | Las Américas', 'Berenice Gress, le interesa una propiedad de Las Américas en Promoción de $585,000.00, le gustaría saber si es una compra segura, trae hasta $700,000.00 en recursos propios. \r\n\r\nLa persona que comprara es su mamá la Sra. Rafaela Gómez, su hermana Lucero Gress quiere participar en la reunión. ', 'Sábado 15 de Enero del 2022 02:00 pm', 'Incompleto', 2, '14-01-2022', '', 'Mayra Diaz', '', '', ''),
