(844, 608, 'Se llamó al prospecto', '18/032022/ 2:15 pm Se contactó al prospecto, comento que recién revisó precalificación de Infonavit y el monto asciende a $390,00.00 la propiedad de su interés es de Remate.\r\nSe explicó la mecánica del crédito y como hacerlo efectivo.', 'Nancy del Carmen Castillo Dominguez', 801, 'Nota', '18/03/2022 02:25 pm'),
(845, 611, 'Se llamó al prospecto', '18/03/2022 12:44 pm Se trató de localizar al prospecto vía telefónica sin respuesta. Se envió Whats y a la 1:11 y comenta que está revisando otras opciones y que si no encuentra me contacta.\r\nle reiteré el compromiso de buscar algo para ella y me dice que ella se comunica para decirme que propiedad le interesa.', 'Nancy del Carmen Castillo Dominguez', 801, 'Nota', '18/03/2022 02:29 pm'),
(846, 609, 'Se llamó al prospecto', '18/03/2022 12:16 pm Se llamó al prospecto y comenta que quiere hacer efectivo un crédito que le proporciona la empresa como una prestación, no especificó que empresa ni que tipo de crédito.\r\nQuiere un inmueble en Puebla con 2 habitaciones 1 parkeo en colonia San Manuel, Anzures o alguna cercana al centro de Puebla, el presupuesto es de $1´800,00.00 con escrituración.\r\nTiene hasta junio para hacer efectivo su crédito.', 'Nancy del Carmen Castillo Dominguez', 801, 'Nota', '18/03/2022 02:34 pm'),
(847, 607, 'Se llamó al prospecto', '18/03/2022 12:11 pm Es Asesor en una Sofom tiene cliente con crédito Fovissste aprobado el 1 de marzo por $560,000.00, la propiedad de interés ya se vendió.\r\nQuedamos al pendiente por si hubiera opción.', 'Nancy del Carmen Castillo Dominguez', 801, 'Nota', '18/03/2022 02:43 pm'),
(848, 590, 'Seguimiento', '18/03/2022 12:30 pm Se llevó a cabo la cita con Leopoldo que menciona su nombre real es Leopoldo Sánchez Farfán, se consultaron las 2 propiedades de su interés, sobre todo la de Cardenales 20 de Jardines Cuautitlán, siendo viable.\r\nSe acordó llamar para brindar esta información y agendar cita la semana entrante para concretar la operación.\r\nComo dato adicional es Administrador Industrial, quiere la propiedad para un proyecto de Casa de atención a ancianos.\r\nEsta sería su 4ta. operación de cesión de derechos. menciona que tiene 3 demandas 1 por divorcio y las otras por cesión de derechos.', 'Nancy del Carmen Castillo Dominguez', 801, 'Nota', '18/03/2022 02:50 pm'),
