INSERT INTO `tickets` (`id`, `tipo`, `asunto`, `descripcion`, `elaboradopor`, `grupo`, `fecharegistro`, `estado`, `seguimiento`, `fechaseg`, `correo`, `evidencia`, `evidenciaseg`, `importancia`) VALUES
(2, 'Sugerencia', 'Notificar Asesores Cambio de Coordinación', 'Sugiero colocar mensaje de aviso, Notificar Asesores Cambio de Coordinación que deben acudir a la empresa para actualizar sus correos y claves de acceso. ', 'Mayra Diaz', 2, '18/02/2022 11:52 am', 'Completado', 'Buen dia!, ya se ha realizado el aviso general para todos los asesores/coordinadores, puedes visualizarlo en el Dashboard o en el apartado Avisos', '02/03/2022 11:58 am', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(3, 'Otros', 'Actualizar Correo y claves del Asesor', 'Actualizar Correo y claves del Asesor 503 - Itzel Soria Barcenas, mail: itzels308@agnorconsultores.com ', 'Mayra Diaz', 2, '18/02/2022 12:13 pm', 'Completado', 'Hola!, ya se ha hecho el cambio de correo electronico del asesor solicitado. Saludos', '', 'contacto@agnorconsultores.com', '', '', ''),
(4, 'Otros', 'Ayudar a Félix con correo institucional', 'Se comunico por whatsapp que tiene problemas con su correo institucional, ¿lo puedes checar por favor?\r\nGracias.', 'David ', 6, '18/02/2022 01:18 pm', 'Completado', 'Conforme a la conversación que se tuvo con Felix, desde el whats de David, se le dio la respuesta de inmediato, y se soluciono', '', 'contacto@agnorconsultores.com', '', '', ''),
(5, 'Cambios (editar prospecto,cita,etc.)', 'Actualizar DRIVE | CRM', 'Buena tarde Carlos\r\n\r\nTe envío el siguiente ticket, por favor cambio en los links compartidos del Drive.. \r\nActualizar\r\nEjemplo: \r\n*Google DRIVE*\r\nAG NOR EDITABLE: Ir a Contenido\r\nLink:  https://drive.google.com/drive/folders/1356bKqLbVDAYdluUWCqNfG3Tr8hkmZ3Z\r\n\r\nRemover del CRM\r\n *Google DRIVE*\r\nCorretaje: Ir\r\nRemates: Ir\r\n\r\nSaludos, \r\nMayra Díaz\r\n', 'Mayra Diaz', 2, '18/02/2022 04:53 pm', 'Completado', 'Buen dia necesito más detalles sobre la solicitud, me comento que iba a ver una repuesta sobre como quedaria.\r\nPor el momento se esta solicitando acceso para verificar si los links funcionan.\r\nActualización 23/02/2022:\r\nSe ha solicitado el permiso a la carpeta de Drive, y ya es posible acceder, ahora se haran los diferentes links para implementarlos en el apartado de \'Mi cuenta\'.\r\nSaludos!', '23/02/2022 01:01 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(6, 'Otros', 'Crear Fichas | Propiedades Recuperadas', 'Crear Fichas | Propiedades Recuperadas, deben ser de color Violeta, te envío correo, gracias. ', 'Mayra Diaz', 2, '18/02/2022 05:03 pm', 'Completado', 'Buen dia, se ha creado una versión de estas, pero es necesario que se actualize con quien esta a cargo de esta linea de negocio\r\nGracias', '02/03/2022 12:35 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(7, 'Cambio de asesores (grupos)', 'Cambios al equipo de trabajo', 'Hola Charly, te mando un par de cambios por favor\r\n\r\n504  Martin Eduardo García Martinez   BAJA DEFINITIVA\r\n\r\n502  María de los Ángeles Hernández Juárez\r\nCambia al equipo de PENELOPE\r\nMe mandas el registro actualizado por favor\r\nMuchas gracias.', 'Baltazar Alcantara', 800, '21/02/2022 11:31 am', 'Completado', 'Buen dia!, ya se ha realizado los cambios solicitados.\r\nCualquier duda o sugerencia me puedes subir tickets, saludos!', '22/02/2022 01:23 pm', 'balcantara@agnorconsultores.com', '', '', ''),
(8, 'Otros', 'Crear Fichas | Brok 8', 'Crear las fichas del Brok 8, del Excel de David. ', 'Mayra Diaz', 2, '21/02/2022 11:55 am', 'Completado', 'Hola!,ya se han realizado las fichas solicitadas, se han subido a la carpeta compartida, con la ubicación como titulo como me comentaste, saludos!', '22/02/2022 01:23 pm', 'contacto@agnorconsultores.com', '', '', ''),
(9, 'Otros', 'Bitácora ', 'Crear Bitácora de Control Interno, para llamadas que se reciban en el teléfono de la oficina.', 'Mayra Diaz', 2, '21/02/2022 11:57 am', 'Completado', 'Buen dia May.\r\nYa quedo implementada esta caracteristica en la v1.13 del CRM.\r\nLo pueden encontrar en el apartado \'Mi cuenta\' y es la primera opción que dice Bitacora\r\nSaludos, cualquier duda o sugerencia me puedes avisar', '23/02/2022 01:04 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(10, 'Sugerencia', 'CRM | Editar', 'Editar: Asignación de cliente.', 'Mayra Diaz', 2, '21/02/2022 11:57 am', 'Completado', 'Hola May!\r\nEsta caracteristica ya se implemento desde la v1.12 del CRM\r\nSolo esta disponible actualmente para usuario administrativos.\r\nSi necesitas que esten para otros usuarios, puedes mandarme tu solicitud y lo revisare con la encargada (Megan)\r\nSaludos!', '23/02/2022 01:17 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(11, 'Sugerencia', 'CRM | Botón de Historial', 'Crear Botón: crearlo para el registros de clientes (bitácora de seguimiento). ', 'Mayra Diaz', 2, '21/02/2022 11:58 am', 'Completado', 'Hola May!\r\nEste registro ya esta disponible en todos los clientes, hay diferentes tipos de seguimiento, para que tenga variedad.\r\nEstos al ser reasignados, pasaran con todo y registro.\r\nCualquier duda o sugerencia, me puede decir\r\nSaludos!', '23/02/2022 01:19 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(12, 'Sugerencia', 'CRM | Notificaciones', 'Notificaciones: Crear la clasificaciones como Generales, Coordinación y Citas. ', 'Mayra Diaz', 2, '21/02/2022 11:58 am', 'Completado', 'Hola May!\r\nYa se implemento esta caracteristica en la v1.11, la cual incluye notificaciones Generales, de mi Coordinacion, y de Sistema.\r\nEsto es para que se visualize los cambios del CRM, para todos los usuarios, ademas esten enterados de lo que pase en sus equipos!\r\nSaludos', '23/02/2022 01:21 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(13, 'Sugerencia', 'CRM | Calendario', 'Calendario: Se debe visualizar en el calendario de citas el mes actual y el del siguiente, esto solo para usuarios administrativos. ', 'Mayra Diaz', 2, '21/02/2022 11:59 am', 'Completado', 'Hola May!\r\nEsta caracteristica esta implementada desde la v1.11 del CRM\r\nEs posible visualizar el mes actual, y el mes siguiente.\r\nAsi sera más facil encontrar citas del siguiente mes.\r\nTambien se añadieron dos botones de leyendas, al dar clic se filtrara por las citas sin seguimiento, o con seguimiento.\r\n\r\nSaludos!', '23/02/2022 01:27 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(14, 'Sugerencia', 'CRM | Tutoriales', 'Crear Tutoriales para el CRM', 'Mayra Diaz', 2, '21/02/2022 12:01 pm', 'Completado', 'Buen dia!,\r\nYa se han implementado esta caracteristica desde la version 1.12 del CRM\r\nSaludos', '28/02/2022 04:34 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(15, 'Sugerencia', 'CRM | Filtros ', 'Crear Filtros de Búsqueda para los registros', 'Mayra Diaz', 2, '21/02/2022 12:02 pm', 'Completado', 'Buen dia May!\r\nEsta caracteristica se añadio en la versión 1.12 del CRM\r\nSaludos', '28/02/2022 04:35 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(16, 'Sugerencia', 'CRM | Segmentación de Equipos', 'Seguridad, segmentación de equipos por coordinador para que solo visualizaran su equipo y no el general. ', 'Mayra Diaz', 2, '21/02/2022 12:02 pm', 'Completado', 'Ya se han implementado estas caracteristicas, para aumentar la seguridad del CRM\r\nSaludos', '28/02/2022 04:35 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(17, 'Sugerencia', 'CRM | Editor para CITAS', 'crear Editor para Citas, para realizar actualizaciones en  Clasificación, Status y Seguimiento', 'Mayra Diaz', 2, '21/02/2022 12:03 pm', 'Completado', 'Se ha añadido la caracteristica para editar estado y agregar el seguimiento de esta\r\nDentro de la información de la Cita\r\n\r\nSaludos!', '28/02/2022 04:36 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(18, 'Sugerencia', 'Control Interno | Calendario de Guardias Preventas', 'Crear Calendario de Guardias para Preventas, Se debe visualizar nombre, fecha y horario ', 'Mayra Diaz', 2, '21/02/2022 12:04 pm', 'Completado', 'Denegado por falta de estructura.\r\nGenerar nuevo ticket, cuando se tenga la información completa,gracias\r\nSaludos!', '02/03/2022 12:33 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(19, 'Sugerencia', 'Control Interno | Bitácora de Actividades ', 'Crear Bitácora de Actividades por Asesor, Registro de publicaciones (Links).', 'Mayra Diaz', 2, '21/02/2022 12:05 pm', 'Completado', 'Hola Mayra!\r\nEsta caracteristica ya se agrego\r\nSaludos', '06/04/2022 04:21 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(20, 'Sugerencia', 'Web AG NOR', 'Realizar propuesta para cambiar la estructura de la Web de AG NOR, contenido, misión y visión. ', 'Mayra Diaz', 2, '21/02/2022 12:05 pm', 'Completado', 'Hola Mayra, no se ha dado seguimiento a este caso.\r\nNo han decidio que se realizara\r\nSaludos', '06/04/2022 04:22 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(21, 'Sugerencia', 'Web AG NOR | Subir las fichas a la Página', 'Web AG NOR | Subir las fichas a la Página de Remate', 'Mayra Diaz', 2, '21/02/2022 12:06 pm', 'Completado', 'Hola Mayra\r\nNo se ha dado seguimiento a este caso, por lo tanto se cerrara\r\nSaludos', '06/04/2022 04:27 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(22, 'Sugerencia', 'Web AG NOR | Subir las fichas a la Página', 'Web AG NOR | Subir las fichas a la Página de Corretaje', 'Mayra Diaz', 2, '21/02/2022 12:07 pm', 'Completado', 'Hola Mayra\r\nNo se ha dado seguimiento a este caso, por lo tanto se cerrara\r\nSaludos', '06/04/2022 04:27 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(23, 'Sugerencia', 'Web AG NOR | Subir las fichas a la Página', 'Web AG NOR | Subir las fichas a la Página de Recuperadas', 'Mayra Diaz', 2, '21/02/2022 12:07 pm', 'Completado', 'Hola Mayra\r\nNo se ha dado seguimiento a este caso, por lo tanto se cerrara\r\nSaludos', '06/04/2022 04:28 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(30, 'Sugerencia', 'Agregar filtros en el Apartado de CITAS', 'Agregar la opción de poder buscar en el apartado de CITAS que sean por \"cliente\" y \"titulo\".', 'Megan Hassel', 4, '22/02/2022 11:54 am', 'Pendiente', '', '', 'meganh@agnorconsultores.com', '', '', ''),
(29, 'Sugerencia', 'Modificación de búsqueda', 'Poder modificar la pestaña de CLIENTES en filtros para poder buscar el cliente sin necesidad de estar checando asesor por asesor.', 'Megan Hassel', 4, '22/02/2022 11:52 am', 'Completado', 'Hola! buen dia, ya quedo implementado desde la version 1.12, cualquier error referente a este cambio sera bienvenido, gracias.', '22/02/2022 01:23 pm', 'sistemas@agnorconsultores.com', '', '', ''),
(31, 'Sugerencia', 'Historial de Movientos', 'seguimiento del ticket 112, Debe reflejar el historial de Cambios movimientos realizados al registro del prospecto. ', 'Mayra Diaz', 2, '22/02/2022 01:12 pm', 'Completado', 'Hola Mayra\r\nEsta caracteristica esta disponible desde la versión 1.12 del CRM\r\nSaludos', '04/04/2022 04:57 pm', 'contacto@agnorconsultores.com', '', 'evidencias/respuestas/', ''),
(42, 'Sugerencia', 'Bitácora de Asesores', 'Bitácora de Actividades por Asesor\r\nRegistro de publicaciones (Links).\r\nDebe estar ingresado en el aparado de \"Mi cuenta\", en Metas, se debe colocar un espacio para colocar link, combo para seleccionar linea de negocio, y una barra del progreso al registrar los links. \r\nSi un link ya esta capturado inhabilitar el campo y que mande mensaje (link ya esta registrado)', 'Mayra Diaz', 2, '22/02/2022 03:05 pm', 'Completado', 'Hola Mayra \r\nEsta caracteristica ya esta agregada\r\nSaludos', '06/04/2022 12:21 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Bitácora Asesores.JPG', 'evidencias/respuestas/', ''),
(43, 'Sugerencia', 'Calendario de Guardia', 'Calendario de Guardias para Preventas\r\nSe debe visualizar nombre, fecha y horario, uno para Oficina y otro para Preventa\r\nOficina: L-V: 10:00 a 17:00 o 11:00 a 18:00hrs, S-10:00 a 14:00hrs.\r\nProyecto: L-D de 10:00 a 19:00hrs (Completo), Medio día (10:00 - 14:30hrs y Media tarde (14:30 a 19:00hrs) validar el horario de medio día con Jesús. ', 'Mayra Diaz', 2, '22/02/2022 03:34 pm', 'Pendiente', '', '', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Calendario de G.JPG', '', ''),
(44, 'Sugerencia', 'Control Interno', 'Graficas para asesores, sobre el No. De clientes que están capturando. ', 'Mayra Diaz', 2, '22/02/2022 05:46 pm', 'Completado', 'Hola Mayra\r\nYa se agrego esta caracteristica\r\nSaludos', '06/04/2022 04:28 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(40, 'Sugerencia', 'Bitácora de Asesores', 'Bitácora de Actividades por Asesor\r\nRegistro de publicaciones (Links).\r\nDebe estar ingresado en el aparado de \"Mi cuenta\", en Metas, se debe colocar un espacio para colocar link, combo para seleccionar linea de negocio, y una barra del progreso al registrar los links. \r\nSi un link ya esta capturado inhabilitar el campo y que mande mensaje (link ya esta registrado)', 'Mayra Diaz', 2, '22/02/2022 03:02 pm', 'Completado', 'Hola Mayra \r\nEsta caracteristica ya quedo implementado desde la versión 1.14 del CRM\r\nSaludos', '06/04/2022 12:19 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(41, 'Actualización', 'Tickets', 'Tickets: Incluir apartado para anexar Archivos o Imágenes', 'Mayra Diaz', 2, '22/02/2022 03:03 pm', 'Completado', 'Hola!, buen dia\r\nYa se ha implementado esta caracteristica desde la v1.13 del CRM.\r\nPueden anexar cualquier documento,  y sera visualizado.\r\nSaludos!', '23/02/2022 12:58 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(45, 'Sugerencia', 'Usuario Administrativo ', 'Notificaciones: Revisar el usuario de Baltazar no tiene los privilegios de Administrador, no puede realizar diferentes actividades. ', 'Mayra Diaz', 2, '22/02/2022 05:47 pm', 'Completado', 'No se ha definido por parte de gerencia que Baltazar tenga control administrativo\r\nPorfavor, verificar y en otro ticket aclarar con evidencia que Baltazar tengo permisos Administrativos\r\nSaludos', '06/04/2022 04:30 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(46, 'Actualización', 'Correos para Citas', 'Al capturar una cita, se debe emitir un correo en automático al asesor que la creo y a Megan. ', 'Mayra Diaz', 2, '22/02/2022 05:49 pm', 'Completado', 'Hola May buen dia!.\r\nYa se ha hecho el cambio desde la v1.13 del CRM.\r\nSolo estara bajo revisión por si algun asesor/coordinador presenta problemas, por el momento ya se implemento.\r\n\r\nSaludos!', '23/02/2022 12:49 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(47, 'Sugerencia', 'Historial de Movimientos Citas ', 'Historial de Movimientos Citas  | Seguimiento de la citas, movimientos y actualizaciones se deben reflejar en el historial de registro', 'Mayra Diaz', 2, '22/02/2022 05:49 pm', 'Completado', 'Hola Mayra \r\nEsta caracteristica ya esta agregada\r\nSaludos', '06/04/2022 12:22 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(48, 'Sugerencia', 'Alerta Atención de Clientes o  reasignara automáticamente', 'Clientes sin atención, (SEMAFORO) \r\nAlerta o correo al asesor para que le de seguimiento al registro al 4to día, de hacer caso omiso al 6to día, se reasignara automáticamente a Atención a Clientes. ', 'Mayra Diaz', 2, '22/02/2022 05:50 pm', 'Completado', 'Hola Mayra \r\nEsta información no se ha dado seguimiento o no se ha confirmado, ya que se estan realizando cambios.\r\nHasta que este algo concreto, dare de alta esta función.\r\nYa se han implementado, pero se necesita concluir en la decision del tiempo\r\nSaludos', '06/04/2022 12:24 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(49, 'Otros', 'Asesores dados de baja', 'Asesores dados de baja, la cuenta de correo AGNOR se deberá redireccionar a la cuenta de contacto@agnorconsultores.com', 'Mayra Diaz', 2, '22/02/2022 05:51 pm', 'Completado', 'Hola May buen dia!.\r\nLos correos ya se estan direccionando al correo contacto@agnorconsultores.com.\r\nA este tipo de servicio se le conoce como Buzón Catch-all, lo que significa que los correo de las personas que se han dado de baja, o que se escriba mal el correo ejemplo: debe ser meganh@ag... pero alguien escribe megann@ag.. esto se redireccionara al correo contacto@ag...\r\nAl llegar demasiados correos de varios buzones, esto hara que el buzon se pueda llenar antes de lo planeado.\r\n\r\nSaludos, si tienes problemas se puede realizar una regla para cada correo que llegue.', '23/02/2022 12:58 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(50, 'Cambios', 'Búsqueda de Prospectos', 'En tiempo real se debe verificar si el prospectos esta registrado, la búsqueda seria por teléfono. \r\nSi ya esta registrado en automático le bloqueará los campos y le mandara una alerta mencionando que el prospecto ya esta registrado. ', 'Mayra Diaz', 2, '22/02/2022 05:53 pm', 'Completado', 'Buen dia, por el momento se esta trabajando en esta caracteristica.\r\nEn estos momentos el CRM solo puede verificar cuando se termina de registrar el cliente.\r\nY le mandara la leyenda \"Ya existe un prospecto registrado, contacta a tu Coordinador para informarle.\"\r\n\r\nEsto es para que el usuario que registre al cliente no pueda identificar por seguridad, que campos se estan comprobando, de esta manera estaria modificando algunos campos para asi dar de alta el prospecto y pasar este filtro.\r\n\r\nAun falta autorización, se espera que este incluida en la version 1.14 del CRM\r\nSaludos', '28/02/2022 04:33 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(51, 'Sugerencia', 'Estadística Asesores', 'Estadística Asesores - Graficas para asesores, sobre el No. De clientes que están capturando. ', 'Mayra Diaz', 2, '22/02/2022 06:05 pm', 'Completado', 'Hola Mayra\r\nEsta caracteristica ya se agrego al CRM\r\nSaludos', '06/04/2022 04:31 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(52, 'Actualización', 'Colocar Nombre del Asesor', 'Colocar el nombre del Asesor, además del grupo, ', 'Mayra Diaz', 2, '23/02/2022 02:23 pm', 'Completado', 'Ya se ha implementado esta caracteristica y esta lista para ser agregada en la siguiente version del CRM 1.14\r\n\r\nSaludos!', '28/02/2022 04:32 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/NOMBRE.JPG', 'evidencias/respuestas/', ''),
(53, 'Actualización', 'DRIVE - Actualizar el General', 'DRIVE - Actualizar el General, el nombre debe ser AG NOR EDITABLE ', 'Mayra Diaz', 2, '23/02/2022 02:29 pm', 'Completado', 'Buen dia May!. La caracteristica ya se ha realizado, pero sera implementada en la siguiente version del CRM 1.14\r\nUna disculpa por el nombre.\r\nen cuanto se implemente en CRM, se cambiara el Estatus a Completado\r\nSaludos', '28/02/2022 04:32 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/AG NOR EDITABLE.JPG', 'evidencias/respuestas/', ''),
(54, 'Actualización', 'Bitácora', 'Agregar en el combo de la bitácora una opción de  ASESOR. ', 'Mayra Diaz', 2, '23/02/2022 02:34 pm', 'Completado', 'Buen dia May!.\r\nLa caracteristica ya se ha realizado, pero sera implementada en la siguiente version del CRM 1.14\r\nSe cambiara el estado del ticket a completado cuando se haya implementado en el CRM\r\nSaludos!', '28/02/2022 04:32 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Asesores.JPG', 'evidencias/respuestas/', ''),
(55, 'Sugerencia', 'Dasboard Cliente', 'En el Dashboard del cliente desparecera por le momento los apartados de ventas para dejar solo los pendientes de citas, dejarlos en la parte derecha.\r\npara asi dejar mas visible el registro del cliente\r\nTambien se unifico Nombre del asignado y grupo', 'Carlos Sistemas Agnor', 1, '24/02/2022 02:44 pm', 'Completado', 'Se esta trabajando en esta caracteristica, se preve que este disponible en la siguiente versión del CRM 1.14\r\n\r\nDe igual forma se implementara más a esta idea para mejorar y visualizar mejor la información del prospecto\r\n\r\nSaludos', '28/02/2022 04:32 pm', 'sistemas@agnorconsultores.com', 'evidencias/solicitudes/dasboardcliente.JPG', 'evidencias/respuestas/', ''),
(56, 'Sugerencia', 'Solicito búsqueda', 'Poder buscar el asesor con su numero de identificación, sin necesidad de que a fuerzas tenga que registrar un cliente. Tan solo por poner su código para ver sus datos o saber si ya esta dado de alta en el CRM.', 'Megan Hassel', 4, '24/02/2022 02:47 pm', 'Completado', 'Hola Megan\r\nEsta caracteristica ya esta dada de alta en el sistema\r\nSi tienes opciones a mejorar, puedes comentar en otro ticket, para agregarlos\r\nSaludos', '06/04/2022 04:32 pm', 'meganh@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(57, 'Sugerencia', 'Campos obligatorios clientes', 'Los campos de opciones en lista, deberan estar obligatorios, para ser llenados correctamente y no se deje algún campo sin rellenar', 'Carlos Sistemas Agnor', 1, '24/02/2022 04:41 pm', 'Completado', 'Ya se ha implementado esta caracteristica y esta lista para ser agregada en la siguiente version del CRM 1.14\r\nGracias', '28/02/2022 04:32 pm', 'sistemas@agnorconsultores.com', 'evidencias/solicitudes/clientesoblig.JPG', 'evidencias/respuestas/', ''),
(58, 'Otros', 'Mouse', 'Equipo de Computo | Cambiar la rueda de desplazamiento del mouse porque no funciona y el teclado no se ven las letras y luego se traban las teclas. ', 'Mayra Diaz', 2, '25/02/2022 11:34 am', 'Completado', 'Hola May!\r\nCon la salida de David, se ha cambiado de lugar a Axel, para asi realizar el cambio de Mouse y Teclado correspondientes\r\nSaludos!', '09/03/2022 11:40 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(59, 'Actualización', 'Lista Negra', 'Colocar en color negro y colocar un icono que identifique que es un cliente repetitivo, en el registro del contacto y en la lista de búsqueda, anexo ejemplo. ', 'Mayra Diaz', 2, '25/02/2022 11:58 am', 'Completado', 'Hola buen dia May!\r\nEsa caracteristica ya ha sido implementada desde la versión 1.15 del CRM\r\nSaludos', '09/03/2022 11:39 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/3.JPG', 'evidencias/respuestas/', ''),
(60, 'Sugerencia', 'SEMAFORO de COLORES', 'SEMAFORO de COLORES | Una vez que se capture el prospecto, el registro debe quedar con el fondo de acuerdo a la selección del tipo de línea de Negocio, la cual esta determinada por las fichas de propiedades.  estos se debe reflejar en la información general de la llamada y en la sección de clientes como si fuera formato de tabla. \r\n\r\nRemate.      Azul\r\nPreventa.    Rosa. O. Verde\r\nRecuperada.  Violeta\r\nCorretaje.   Gris', 'Mayra Diaz', 2, '25/02/2022 12:30 pm', 'Completado', 'Hola Mayra\r\nEsta caracteristica en su momento no era posible desarrollarla por problemas con la información que se mostraba.\r\nAhora ya se termino de añadir esta caracteristica, se estima que se encuentre en la versión 1.18 del CRM\r\n\r\nSaludos', '08/04/2022 12:57 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(61, 'Cambios', 'Cambio a campo de busqueda', 'Se debera cambiar el campo de busque de \'Medio publicitario\' por buscar por \'Linea de negocio\'', 'Carlos Sistemas Agnor', 1, '25/02/2022 01:46 pm', 'Completado', 'Hola!\r\nEsta caracteristica esta implementada desde la versión 1.15 del CRM\r\nSaludos', '09/03/2022 11:38 am', 'sistemas@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(62, 'Sugerencia', 'Scroll tablas y algunos contenidos', 'Tablas como Clientes y Citas, se moveran en un campo reducido, esto hara que la parte superior (la que define que contenido debe ir en esa fila) quede fijada y asi visualizar que información se vera mientras se despliega la información.\r\n\r\nIgual con algunos textos, como Seguimiento del Cliente, Avisos, Tutoriales.\r\nEsto para que no se tenga que desplegar tanto tiempo y sea comodo tambien en versiones web celular.\r\nSaludos!', 'Carlos Sistemas Agnor', 1, '25/02/2022 02:32 pm', 'Completado', 'Se esta trabajando en esta caracteristica por lo que se espera que este disponible en la nueva versión del CRM 1.14\r\nAun asi se esta mejorando esta caracteristica para mantener el rendimiento del sitio y no saturarlo, esto ayudara a que la página cargue con más rapidez.\r\n\r\nSaludos', '28/02/2022 04:31 pm', 'sistemas@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(63, 'Error de Página', 'Registro no guardado', 'Capture los datos de mi cliente y se visualiza en sistema, como si no lo hubiera capturado, anexo pantallas. le avise a la chica de Atención a Clientes y me dijo que levantara el ticket. ', 'Francisco García Ramírez', 405, '26/02/2022 12:34 am', 'Completado', 'Hola buen día, una disculpa por lo sucedido, había un problema con servidor.\r\nYa se ha solucionado, es posible dar de alta el cliente con normalidad.\r\nDisculpa por las molestias ocasionadas, si el problema persiste reportarlo.', '26/02/2022 12:41 pm', 'franciscog405@agnorconsultores.com', 'evidencias/solicitudes/CRM no aparece registro.odt', 'evidencias/respuestas/imagen_2022-02-26_124056.png', ''),
(64, 'Otros', 'no me toma la captura de un cliente, manda pagina en blanco', '2 veces capture al prospecto Enrique Moreno Fonseca 5545564573   5613307903   jemoreno987@gmail.com y como respueta manda PAGINA EN BLANCO y terminó NO CAPTURANDOLO\r\n', 'Baltazar Alcantara Bustos', 800, '26/02/2022 11:15 am', 'Completado', 'Hola buen día, una disculpa por lo sucedido, había un problema con servidor.\r\n Ya se ha solucionado, es posible dar de alta el cliente con normalidad.\r\n Disculpa por las molestias ocasionadas, si el problema persiste reportarlo', '26/02/2022 12:41 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/capturacliente.PNG', ''),
(65, 'Otros', 'Configurar Contactos', 'Configurar Contactos | configurar contactos en las cuentas de correo de lo chicos de Jurídico, están enviando de forma errónea los correos, configurar en sus cuentas en bonito por favor. ', 'Mayra Diaz', 2, '28/02/2022 11:12 am', 'Completado', 'Buen dia May!\r\nYa se actualizaron 4 Maquinas destinadas a Juridico, se añadieron todos los contactos registrados hasta el momento, y se guardo el archivo para futuras maquinas a configurar.\r\n\r\nSaludos', '01/03/2022 03:05 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/1.JPG', 'evidencias/respuestas/', ''),
(66, 'Otros', 'Teléfono Físico', 'Teléfono Físico | Revisar el de recepción porque cada vez que nos llama se entre corta la llamada o no se escucha bien lo que comenta el oficial. ', 'Mayra Diaz', 2, '28/02/2022 02:34 pm', 'Pendiente', '', '', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', '', ''),
