(68, 'Otros', 'Celular de la Empresa', 'Celular de la Empresa | se revise la conexión de internet porque en ocasiones la conversación del cliente se escucha entre cortado o la señal a veces se corta. ', 'Mayra Diaz', 2, '28/02/2022 02:37 pm', 'Pendiente', '', '', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', '', ''),
(69, 'Sugerencia', 'DashB', 'Dashboard | Crearlo para Atención a clientes, gráficos que indiquen la estadística de los prospectos Mensual\r\nMedio Publicitario, Línea de Negocio, Tipo de Propiedad, Cita, que tanga un filtro que al elegir el Becario se actualice la información. Status final del prospecto, espacio de comentarios relevantes Highlights. ', 'Mayra Diaz', 2, '28/02/2022 02:50 pm', 'Completado', 'Hola Mayra\r\nEsta caracteristica ya se agrego y se ocupara para Coordinadores y Atencion a clientes\r\nSe estan realizando las pruebas necesarias para que este todo en orden\r\nLo puedes encontrar en tu perfil como \'Mi panel 2\'\r\nSaludos', '06/04/2022 04:38 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Para Mi DAsh.docx', 'evidencias/respuestas/', ''),
