(71, 'Otros', 'Publicar aviso de interes GENERAL', 'Estimados compañeros AG NOR.\r\n\r\nEl mes de Febrero para las personas que saben lo que quieren, fue un mes de mucho esfuerzo y muy poco resultado, ANIMO, TODO lo que se siembra en la vida se recibe MULTIPLICADO para bien o para mal, las leyes universales nunca fallan y TU SABES realmente cual fué tu siembra el mes pasado.\r\n\r\nLos invito a que se sigan esforzando, la META DE MARZO es de 2 VENTAS por asesor ya que hay que reponer la venta del mes de Febrero.\r\n\r\nEste mes van a recibir los frutos de lo hecho en Febrero, más sus 15 publicaciones SEMANALES sin falla estoy seguro que los resultados serán satisfactorios.\r\n\r\nEn el caso de Remates Bancarios, por instrucciones de la Dirección General y nuestra área Legal, favor de realizar FICHAS UNICAMENTE de los siguientes lugares:\r\n-CDMX\r\n-Estado de México incluyendo Toluca\r\n-Acapulco\r\n-Puebla\r\n-Querétaro\r\n-Veracruz\r\n-Toluca\r\n-Monterrey\r\nDel estado de Morelos, únicamente...\r\n-Cuernavaca (con alberca de preferencia)\r\n-Jiutepec\r\n\r\nLes deseo TODO el éxito del mundo, SI SE PUEDE????????????????????????', 'Baltazar Alcantara Bustos', 800, '01/03/2022 04:34 pm', 'Completado', 'Hola Balta buena tarde\r\nTu aviso ya se dio de alta\r\nSaludos!', '01/03/2022 06:11 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(72, 'Otros', 'Usuarios AC', 'Colocar las iniciales de cada persona en automático, en las notas del registro y en el seguimiento, (Detalles).  Esto para los usuarios de atención a clientes, gracias. \r\nAG.DR\r\nAG.AC\r\nAG.MD\r\n\r\n', 'Mayra Diaz', 2, '02/03/2022 01:15 pm', 'Completado', 'Hola Mayra!\r\nYa desde la versión 1.15 del CRM se ha implementado esta caracteristica.\r\n\r\nSaludos!', '04/03/2022 01:41 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
