(95, 'Cambios', 'Modificar fecha de cita', 'Charly, me cambias la fecha de la cita por favor.\r\nRegistre 11-03-2022 y lo correcto es el lunes 14-03-2022 a las 11 am\r\nCliente Jimena Rivera Calderon', 'Baltazar Alcantara Bustos', 800, '11/03/2022 12:38 pm', 'Completado', 'Hola Balta!\r\nYa quedo el registro cambiado a el 14-04-2022 a las 11 am\r\n\r\nSaludos', '11/03/2022 12:46 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/citablata.JPG', ''),
(96, 'Actualización', 'Forma de Pago', 'Incluir en Forma de Pago los siguientes Créditos u opciones. \r\n\r\nInfonavit y Recursos Propios\r\nFovissste y Recursos Propios\r\nCFE\r\nIssemym\r\nSOFOM\r\nHIR Casa\r\nICA (Prestamos y Financiamiento)\r\nIMSS\r\n', 'Mayra Diaz', 2, '11/03/2022 04:22 pm', 'Completado', 'Hola Mayra!\r\nBuen dia, estas formas de pago seran incluidas dentro de la versión 1.16\r\nEspero que muy pronto quede actualizada,.\r\nSaludos', '14/03/2022 01:50 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(97, 'Error de Página', 'Alta de registro', 'Al dar de alta un registro, las notas aparecen en el registro anterior, se ha detectado con los registros de Axel y de Baltazar A. ', 'Mayra Diaz', 2, '11/03/2022 04:26 pm', 'Completado', 'Hola Mayra!\r\nBuen dia, este error se ocasionaba por que el sistema detectaba que se registraria rapido los prospectos, por lo que  el registro lo guardaba el primero que dio de alta.\r\nPero ahora ya no hay ese problema y espero que este bien.\r\nSaludos', '14/03/2022 11:04 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(98, 'Error de Página', 'FALATA DE INFORMACION EN EL CRM ', 'ATENCION A CLIENTES PONE DATOS Y NO LOS PUEDO VER SOBRE EL CLIENTE CARLOS SANTANA SOLO SE GUERDA Y PUEDO VER LO QUE YO REGISTRO \r\n', 'Itzel Soria Barcenas', 503, '11/03/2022 04:54 pm', 'Completado', 'Hola Itzel!\r\nYa se ha arreglado este problema, espero que ya puedas visualizar la información\r\nSaludos', '11/03/2022 05:16 pm', 'itzels503@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(99, 'Creación de usuario o correo', 'Dar de alta usuarios', 'Charly buenas tardes, para solicitarte los correos y claves de acceso de los siguientes asesores de Nuevo Ingreso\r\nERICK FAUSTO SANCHEZ RODRIGUEZ    TEL: 5535338911\r\nROSA PÉREZ LOZA    TEL: 5530238469\r\nARANZA GUADALUPE OBREGÓN PÉREZ    TEL: 5567359337\r\nGracias :)\r\n', 'Penelope  Carrera Becerra', 200, '14/03/2022 12:57 pm', 'Completado', 'Hola Penelope!\r\nBuenas tardes, ya se han registrado, a los usuarios, ya tienen correo institucional; usuario y contraseña dentro del CRM.\r\nSolo faltaria que vengan para firmar el aviso de confidencialidad, para liberar las contraseñas\r\nSaludos!\r\nTe envio el archivo para que se pueda mandar y que lo firmen, escanen, te lo manden a ti, y me lo puedas enviar al correo porfa\r\nGracias', '14/03/2022 03:47 pm', 'penelope@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/SOLICITUD DE USUARIO Y CONTRASEÑA .pdf', ''),
(100, 'Otros', 'cambio de teclado', 'cambio de teclado, porque falla y ya me lo haz arreglado varias veces. Se traba y deja de escribir', 'Maria Teresa Martinez Guzman', 205, '15/03/2022 11:28 am', 'Completado', 'Hola que tal\r\nYa quedo, se hizo cambio de teclado para que esto ya no este fallando\r\nsi el problema persiste, volver a reportarlo, por que puede ser fallo de la instalación electrica\r\nSaludos', '15/03/2022 02:03 pm', 'mariat205@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/tecladomaritere.jpeg', ''),
(101, 'Cambios', 'Editar registros', 'Carlos por favor al Editar los registros se deben visualizar todos los cambios, hoy me di cuenta que coloque en el apellido el correo y también quería actualizar la forma de pago y no lo pude hacer. si me ayudas para que se vean todos los campos del registros para editarlos, gracias. ', 'Mayra Diaz', 2, '16/03/2022 12:16 pm', 'Completado', 'Hola Mayra! Buen dia\r\nEstas caracteristicas de edición seran incluidas dentro de la versión 1.16 \r\nEspero que muy pronto quede actualizada\r\nSaludos', '17/03/2022 11:24 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Editar.JPG', 'evidencias/respuestas/', ''),
(102, 'Cambios', 'cambio de nombre en cita', 'Cambiar porfavor la cita de Homero Reyes a Rogelio Martinez.', 'Maria Teresa Martinez Guzman', 205, '17/03/2022 11:21 am', 'Completado', 'Hola Maite Buen dia!\r\nYa quedo tu cambio, si el problema persiste, reportalo.\r\nGracias', '17/03/2022 11:24 am', 'mariat205@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(103, 'Sugerencia', 'FALTA ', 'EN LAS HERAMIENTAS EXTRAS, FALTA LA PAGINA DE CEDUVI ', 'Diana Dominguez Rodriguez', 100, '17/03/2022 03:19 pm', 'Completado', 'Hola Diana!\r\nFalto proporcionarme el link directo el cual utilizan porfavor, para incluirlo a la lista.\r\nSaludos!\r\nExtra: Ya se dio de alta el apartado de CEDUVI, checar que si sea el link correcto\r\nSaludos', '04/04/2022 04:55 pm', 'dianad@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(104, 'Error de Página', 'No me toma el criterio de busqueda', 'Cuando quiero hacer una busqueda CLIENTES pongo el nombre y no me da nada.\r\nNo hace la busqueda', 'Baltazar Alcantara Bustos', 800, '17/03/2022 03:47 pm', 'Completado', 'Hola buen dia Balta!\r\nSe ha solucionado este error en la versión 1.16 del CRM\r\nSaludos. si el error persiste, reportarlo porfavor\r\nGracias', '18/03/2022 10:37 am', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(105, 'Actualización', 'Actualizar la tabla de tiempos de entrega en Remates Bancarios ', 'Charly te mando la nueva tabla de tiempos de entrega de propiedades segun su status legal en Remates Bancarios\r\n\r\nEliminar la anterior por favor', 'Baltazar Alcantara Bustos', 800, '17/03/2022 05:21 pm', 'Completado', 'Hola Balta buen dia\r\nYa quedo actualizado los tiempos de entrega en los estatus legales\r\nPuedes verificar?\r\nGracias\r\nSaludos', '18/03/2022 11:37 am', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/Status y su significado en tiempo de entrega.pdf', 'evidencias/respuestas/', ''),
(106, 'Problemas con equipo de computo (Mouse, teclado, etc.)', 'Cambio de teclado', 'Solicito cambio de teclado, no se ven las letras', 'Mayra Diaz', 2, '18/03/2022 12:00 pm', 'Completado', 'Buen dia Mayra\r\nYa s eha hecho el cambio de teclado, se detecto que tiene errores al escribir por el momento, se cambio a la maquina 2, por que se utiliza poco.\r\nSaludos', '18/03/2022 12:06 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(107, 'Problemas con equipo de computo (Mouse, teclado, etc.)', 'cambiar mouse porque no sirve', 'Cambiar mouse a la maquina 4 porque no funciona la ruedita. ', 'Mayra Diaz', 2, '18/03/2022 12:04 pm', 'Completado', 'Hola Mayra\r\nYa se realizo el cambio, por el momento se cambio a la maquina 2, ya que se utiliza poco\r\nEn lo que se solicitan nuevo equipo, para realizar la sustitución completa.\r\nSaludos', '18/03/2022 12:07 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(108, 'Sugerencia', 'Apartado de Clientes Checkbox', 'Apartado de Clientes Checkbox, visualizar varias opciones que se desactive o se desactive ejemplo checkbox del teléfono, si se desactiva no se visualizara la información. gracias. :)', 'Mayra Diaz', 2, '18/03/2022 12:15 pm', 'Completado', 'Hola Mayra!\r\nYa quedo esta opción implementada en la versión 1.17 del CRM\r\nSaludos\r\nCualquier ajuste o extra, mandar ticket', '04/04/2022 04:54 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(109, 'Sugerencia', 'Solicitud', 'Solicitud de citas generadas por el área de Atención a Clientes. ', 'Mayra Diaz', 2, '18/03/2022 05:59 pm', 'Completado', 'Hola Mayra!\r\nYa quedo esta opción implementada en la versión 1.17 del CRM\r\nSaludos', '12/04/2022 10:50 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(110, 'Otros', 'Eliminar cita del calendario ', 'Eliminar cita del calendario  del Registro de Marlen Rodriguez', 'Maria Margarita Torres Barrueta', 805, '19/03/2022 12:52 pm', 'Completado', 'Hola margarita\nYa quedo eliminada la cita de Marlen Rodriguez\nPara la proxima me añades mas detalles porfavor, de lo contrario, se borrara el mas reciente, aun que tenga o no seguimiento.\nSaludos', '22/03/2022 10:27 am', 'mariam805@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(111, 'Otros', 'Eliminar cita', 'Por error la cita del cliente Saul Jonathan Torres se repitió', 'Maria Margarita Torres Barrueta', 805, '22/03/2022 09:09 am', 'Completado', 'Hola margarita\r\nYa quedo eliminada la cita de Saul Jonathan Torres \r\nPara la proxima me añades mas detalles porfavor, de lo contrario, se borrara el mas reciente, aun que tenga o no seguimiento.\r\nAdemas de que el tipo de solicitud no es \'Otros\' es \'Error Mio/Humano (UP)\r\nSaludos', '22/03/2022 10:28 am', 'mariam805@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', '');
INSERT INTO `tickets` (`id`, `tipo`, `asunto`, `descripcion`, `elaboradopor`, `grupo`, `fecharegistro`, `estado`, `seguimiento`, `fechaseg`, `correo`, `evidencia`, `evidenciaseg`, `importancia`) VALUES
(112, 'Otros', 'Alta en lista negra de 2 personas', 'Favor de registrar en LISTA NEGRA\r\n\r\nLeopoldo Sanchez Farfan\r\nlsfarfan@pendulum.com.mx\r\nlesafarfan@gmail.com\r\n5510788350\r\n5511773609\r\n\r\nEdmundo San Juan\r\nedmundo91sanjuean@gmail.com\r\n7732004268\r\n\r\nPERSONAS INDESEABLES ya que se dedican exactamente  a nosotros a vender Cesiones de Derechos y se hacen pasar por clientes, seguramente para investigarnos que es lo que hacemos.', 'Baltazar Alcantara Bustos', 800, '22/03/2022 03:30 pm', 'Completado', 'Hola Balta!\r\nYa se ha registrado a los dos prospectos en \'Lista negra\'\r\nSolo para recordarte que desde la versión 1.16 del CRM, ya es posible editar los clientes y asi editar su estado de este\r\nSaludos!', '22/03/2022 03:41 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(113, 'Sugerencia', 'Notificación de reasignación de registros', 'Notificación de reasignación de registros, además de que se le notifique al asesor que tiene un prospecto asignado, también que le llegue al Coordinador. gracias. ya lo platicamos. ', 'Mayra Diaz', 2, '23/03/2022 01:04 pm', 'Completado', 'Hola May, ya esta implementado esta caracteristica desde la version 1.16 del CRM\r\nSaludos', '04/04/2022 12:50 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(114, 'Sugerencia', 'Programar, grabación ', 'Programar grabación para buzones de voz, para el celular y el teléfono de la oficina.\r\n\r\nMensaje: Gracias por llamar al área de Atención a Clientes de Agnor, nuestro horario de atención es de 10:00 a las 18:00hrs de lunes a viernes, sábados de 10:00 a 14:00hrs, me puedes enviar WhatsApp a este mismo numero con tu nombre, anuncio que viste, correo electrónico y solicitud, gracias.  \r\n', 'Mayra Diaz', 2, '25/03/2022 05:52 pm', 'Pendiente', '', '', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', '', ''),
(115, 'Sugerencia', 'Que las consutas sean a nivel de todos los registros', 'Que al hacer una consulta de datos, se realice en toda la base de datos, es decir SIN IMPORTAR que sea de otros equipos\r\nSi es de otros equipo que UNICAMANENTE mande una alerta de que ya existe un registro PREVIO.\r\nLos campos a considerar en la consulta serían\r\nNombre\r\nApellido\r\nCorreo\r\nTelefono\r\n', 'Baltazar Alcantara Bustos', 800, '29/03/2022 12:51 pm', 'Pendiente', '', '', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', '', ''),
(116, 'Sugerencia', 'Agregar comentario en citas', 'Es para confirmarles al asesor el apoyo jurídico o notificarles que cambien la hora de cita ya que hay muchas citas en ese horario o no se podrá el apoyo que solicitaron en ese día y horario, Gracias y por favorcito', 'Megan Hassel', 4, '29/03/2022 02:09 pm', 'Completado', 'Hola Meg\r\nEsto ya quedo implementado desde la versión 1.17\r\nEspero que este bien, cualquier comentario estoy al pendiente\r\nSaludos', '04/04/2022 04:52 pm', 'meganh@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(117, 'Otros', 'Mi PC', 'Mi PC no funciona, esta muy lenta y se tarda en abrir los programas, mi WhatsApp tarda en abrir 15 minutos, además se pasma, hasta 2 minutos. por favor revisar la capacitad, por favor dar mantenimiento en general.  URGEEEEEEEE', 'Mayra Diaz', 2, '31/03/2022 01:06 pm', 'Completado', 'Hola May!\r\nYa se realizo el mantenimiento, por lo que no deberias de tener tantos problemas.\r\nEl problema principal es la memoria RAM, la cual ya se ha solicitado en repetidas ocasiones; se enviara un correo electronico a gerencia para solicitar nuevamente su componente, y asi descartar un posible problema.\r\nGracias', '04/04/2022 11:47 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/memroia ram05ma.png', ''),
(118, 'Sugerencia', 'Colocar tipo de importancia en los tickets. ', 'Colocar tipo de importancia en los tickets.  porque en mi anterior ticket no aparece e Urgeeeee', 'Mayra Diaz', 2, '31/03/2022 01:07 pm', 'Completado', 'Hola May!\r\nYa ha aparece la urgencia de la solicitud\r\nEspero que este bien\r\nSaludos', '04/04/2022 04:51 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(119, 'Otros', 'Actualizar Exportación de datos', 'Por favor actualizar los datos para exporta, cada vez se seleccionar los datos Mes, año, Alta iniciada, Asesor se muestren los datos en las gráficas. Sea para el grupo en general ejemplo 80, 40 o bien un solo asesor en específico. Los gráficos se deben mover de acuerdo a los filtros. Si se puede colocar el numero de alcance en las barras o total. ', 'Mayra Diaz', 2, '31/03/2022 01:17 pm', 'Pendiente', '', '', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Actualizar CRM Urgente.docx', '', ''),
(120, 'Otros', 'Agregar a MP2', 'Agregar a MP2, solo cuando se exporte. \r\nMedio publicitario (eliminar link y dejar solo dirección), Los campos línea de negocio, tipo de propiedad. Forma de pago y Monto\r\n\r\n', 'Mayra Diaz', 2, '31/03/2022 02:01 pm', 'Completado', 'Buen dia Mayra\r\nYa quedo implementado esta caracteristica en la versión 1.17\r\nCualquier duda o sugerencia, avisar\r\nGracias, saludos', '31/03/2022 04:30 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(121, 'Otros', 'Aviso a TODO AGNOR', 'Se le informa a TODA LA FUERZA DE VENTAS que ya NO se trabajará el Brok 6 de Remates Bancarios, hasta nuevo aviso.\r\nFavor de NO promover NADA de este Brok\r\nMuchas gracias', 'Baltazar Alcantara Bustos', 800, '01/04/2022 11:58 am', 'Completado', 'Hola balta una disculpa no fue posible subir el aviso el dia que solicitaste.\r\nPero ya esta el aviso\r\nSaludos', '04/04/2022 10:55 am', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(122, 'Cambios/Actualización en datos Cliente, Cita, etc.', 'Cambios en los telefonos', 'Ya lo platicamos, hacer el cambio en los teléfonos, primero celular y luego el numero local. ', 'Mayra Diaz', 2, '04/04/2022 11:47 am', 'Completado', 'Hola May, en la siguiente actualización cambiara el orden de los telefonos\r\nSaludos', '04/04/2022 12:08 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Telefono.JPG', 'evidencias/respuestas/', ''),
(123, 'Otros', 'Configurar mi correo para Drive', 'Configurar mi correo para Drive el de contacto por favor. ', 'Mayra Diaz', 2, '04/04/2022 12:09 pm', 'Completado', 'Hola May\r\nYa quedo configurado la contraseña es la misma que tu CRM.\r\nSaludos', '04/04/2022 12:23 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', ''),
(124, 'Cambio/Actualización de asesores/grupos', 'dar de baja usuario', 'Charly favor de dar de baja al asesor Daniel Robledo por fa.\r\nGracias :)', 'Penelope  Carrera Becerra', 200, '04/04/2022 03:26 pm', 'Completado', 'Hola Peni, ya ha quedo dado de baja el usuario\r\nSaludos', '04/04/2022 04:49 pm', 'penelope@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(125, 'Sugerencia', 'REGISTROS DE PUBLICACIONES', 'CARLOS ESTOY REVISANDO LAS PUBLICACIONES DE MIS ASESORES  Y AL PALOMEARLO ME REGRESA AL INICIO.\r\n\r\nPODRAS AYUDARNOS A QUE QUEDE EN DONDE VAMOS POR QUE EL NUMERO DE LINKS A AUTORIZAR EN ESTE MOMENTO ES GRANDE.\r\nGRACIAS', 'Miriam  Claudia Molina', 300, '06/04/2022 12:10 pm', 'Completado', 'Hola Miriam\r\nYa se ha añadido esta caracteristica para facilitar este tipo de operaciones, espero que te sea util.\r\nCualquier duda estoy al pendiente\r\nSaludos', '06/04/2022 12:16 pm', 'miriamc300@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(126, 'Cambio/Actualización de asesores/grupos', 'Solicitud de NIP', 'Carlos me ayudas a recuperar el NIP para iniciar sesión en CRM de mi asesora 408 Verónica Velázquez, porfa.\r\n\r\nGracias!', 'Jesus Romero Salome', 400, '06/04/2022 08:08 pm', 'Completado', 'Hola Jesus\r\nBuen dia, este es el NIP para iniciar sesión en el CRM\r\nde Veronica Velazquez: veronicav#40868\r\nSaludos', '07/04/2022 10:39 am', 'jromero@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Super urgente'),
(127, 'Soluciones generales (Impresora, Correos)', 'Actualización de pagina web', 'cambiar imágenes dentro ', 'Karen Pechir', 5, '07/04/2022 01:13 pm', 'Completado', 'Hola  Karen\r\nYa esta el video en la pantalla principal de la página web.\r\n\r\nSaludos', '07/04/2022 04:14 pm', 'karenpechir@agnorconsultores.com', 'evidencias/solicitudes/153635408_512106933522124_1752312128321335756_n.jpg', 'evidencias/respuestas/eviwebvideo.JPG', 'Media'),
(128, 'Sugerencia', 'Agregar ', 'Colocar la opción de Crédito en la forma de pago.  ya lo hablamos', 'Mayra Diaz', 2, '08/04/2022 11:49 am', 'Completado', 'Buena Tarde Mayra\r\nEsta caracteristica ya se realizo, y estara disponible en la nueva versión del CRM 1.18\r\nSaludos', '08/04/2022 05:02 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Baja'),
(129, 'Sugerencia', 'campo Rango', 'Colocar un nuevo campo Rango de precios, ya lo platicamos', 'Mayra Diaz', 2, '08/04/2022 12:01 pm', 'Completado', 'Se ha colocado el rango de precios.\r\nYa se platico, y en la siguiente versión del CRM 1.18\r\n\r\nSaludos', '08/04/2022 06:03 pm', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Baja'),
(130, 'Soluciones generales (Impresora, Correos)', 'COLOCAR UN AVISO PARA MI EQUIPO', 'Charly buenas tardes, podrías poner un aviso de mi parte a mis vendedores:\r\nTendremos junta de equipo el próximo martes 12 de Abril a las 12:00 pm en nuestras oficinas. Es de carácter obligatorio, contamos con su asistencia.', 'Penelope  Carrera Becerra', 200, '08/04/2022 03:30 pm', 'Completado', 'Hola Peni\r\nMe comentaste que lo subirias tu, en tus avisos\r\nSaludos', '08/04/2022 05:00 pm', 'penelope@agnorconsultores.com', 'evidencias/solicitudes/post de alquierler venta de casa propiedad inmueble servicio profesional azul.png', 'evidencias/respuestas/', 'Media'),
(131, 'Sugerencia', 'Colocar correo de sistemas', 'Por favor colocar el correo de sistemas en el tutorial de correo Gmail, para enviarte los datos de usuario y contraseña.\r\nGracias', 'Dulce Oyuki Marquez Nequiz', 101, '12/04/2022 01:46 pm', 'Completado', 'Hola Dulce\r\nEste detalle se ha agregado, y estara disponible en la nueva versión del CRM 1.18\r\nSaludos', '13/04/2022 10:14 am', 'dulceo101@agnorconsultores.com\n', 'evidencias/solicitudes/ayudacorreosistemas.JPG', 'evidencias/respuestas/', 'Media'),
(132, 'Error de Página', 'No aparece e el sistema seguimiento ', 'Al entrar a la sección de citas en el panel de seguimiento no aparecen las notas que se han agregado', 'Tania Isabel Del Valle Ramirez  y Daniel Flores', 102, '12/04/2022 02:21 pm', 'Completado', 'Hola buen dia Tania\r\nEsta caracteristica ya se ha arreglado, era un problema de programación.\r\nEstara disponible en la nueva versión del CRM 1.18\r\nSaludos', '13/04/2022 10:15 am', 'taniai102@agnorconsultores.com', 'evidencias/solicitudes/Screenshot_20220412-141653.png', 'evidencias/respuestas/', 'Media'),
(133, 'Cambios/Actualización en datos Cliente, Cita, etc.', 'en mis nuevas publicaciones no me aparecen,se ven en rojo porque?', 'he realizado publicaciones en marquet place el dia de hoy y me aparecen en rojo porque?', 'Claudia  Sofia Moncada Tovar', 201, '16/04/2022 08:51 am', 'Completado', 'Hola Sofia\r\nEsto es debido a que tu Coordinador debe verificar las publicaciones y así aparecerá en verde como validado.\r\nEn estos casos debes de hablar con tu coordinador para que te apoye validándolas.\r\nSaludos', '19/04/2022 12:22 am', 'claudias201@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(134, 'Error de Página', 'en mis nuevas publicaciones no me aparecen,se ven en rojo porque?', 'He estado publicando en viva anuncios y tampoco me permite agregar me aparece que ya esta registrado cuando apenas las realice hoy.', 'Claudia  Sofia Moncada Tovar', 201, '16/04/2022 11:14 am', 'Completado', 'Hola Sofia\r\nEsto es debido a que tu Coordinador debe verificar las publicaciones y así aparecerá en verde como validado.\r\nEn estos casos debes de hablar con tu coordinador para que te apoye validándolas.\r\nSaludos', '19/04/2022 12:22 am', 'claudias201@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Alta'),
(135, 'Error de Página', 'No puedo acceder con mis claves desde esta pagina en inmuebles 24y viva anuncios', 'hola,no puedo acceder con mis claves desde este portal a viva anuncios y a inmuebles 24,ayuda,no puedo publicar.,me indica que no se encuentra en google.el correo.\r\nclaudias201@agnorconsultores.com\r\nclave. Agnorsa#006\r\nagradeceria me lo chequen.gracias.', 'Claudia  Sofia Moncada Tovar', 201, '16/04/2022 11:48 am', 'Completado', 'Buen dia Sofia\r\nClaro paso tu reporte al area correspondiente, ya que no tengo accesos a estas plataformas.\r\n\r\nSaludos', '19/04/2022 10:11 am', 'claudias201@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(136, 'Alta usuario CRM y/o Correo', 'asesor nuevo', 'Buenos dias.\r\n\r\ntengo una asesora nueva asisgnada a mi equipo llamada Sofia Duran, creo no es de mi equipo te aviso Charly por favor para que se le cambie al equipo correcto.\r\n\r\nGracias por tu atencion.', 'Miriam  Claudia Molina', 300, '18/04/2022 11:47 am', 'Completado', 'Hola  Miriam Buenos dias\r\nClaro gracias Miriam.\r\nLo checo, ya que no me mencionaron nada de otro equipo, pero lo averiguo.\r\nGracias, saludos', '19/04/2022 10:18 am', 'miriamc300@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(137, 'Error Mio/Humano (UP)', 'Facebook', 'Facebook, alguien esta contestando mis chats te mando el link de lo que publiqué y alguien mas esta contestando, y por favor me quitas como editor de la pagina u Facebook esta como Atención a clientes, te mando la imagen', 'Mayra Diaz', 2, '18/04/2022 12:50 pm', 'Completado', 'Buen dia Mayra.\r\nEse facebook es personal de la empresa por lo que solo teniendo el usuario y contraseña pueden ingresar.\r\nEl marketplace es de ese, no de la página de AG NOR, ya se habia comentado en su momento, pero se quitara tu cuenta de la página de AG NOR, saludos', '19/04/2022 10:20 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/Facc.JPG', 'evidencias/respuestas/', 'Alta'),
(138, 'Alta usuario CRM y/o Correo', 'Crear Usuarios Becarios', 'Crear los usuarios para los becarios, Víctor Arturo Ramírez  y Alan Ávila  ', 'Mayra Diaz', 2, '18/04/2022 06:04 pm', 'Completado', 'Buen día \r\nMayra\r\n\r\nSi gracias, no es necesario confirmar la creación de los Tickets.\r\nEn tu correo mencionas que urgen estos usuarios.\r\nPero no es posible dar de alta estos usuarios por falta de información, tu ticket fue cerrado por ese motivo.\r\n\r\nRecuerda que para dar de alta un usuario en CRM, se necesitan los siguientes datos\r\n1.	Nombre Completo del usuario (Obligatorio)\r\n2.	Número Telefónico (Obligatorio)\r\n3.	Firmar Aviso de confidencialidad donde se entrega correo, usuario y contraseña\r\n4.	Usuario y contraseña plataforma Inmuebles24 (No obligatorio)\r\n5.	Usuario y contraseña plataforma Vivanuncios (No obligatorio)\r\n', '19/04/2022 10:11 am', 'contacto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Alta'),
(139, 'Error Mio/Humano (UP)', 'REGISTRO DE LINK INCORRECTO', 'CHARLY BUENOS DIAS\r\n\r\nUN FAVOR MI ASESORA GUADALUPE URIBE COPIO MAL EL LINK PARA DAR DE ALTA Y EL REGISTRO APARECE COMO INCORRECTO.Ç\r\n\r\nPODRAS AYUDARME A CANCELARLO O ELIMINARLO\r\n\r\nLOS FOLIO QUE APARECEN SON 63825824 Y 63825869\r\n\r\nGRACIAS', 'Miriam  Claudia Molina', 300, '19/04/2022 11:23 am', 'Completado', 'Hola Miriam Buenos dias\r\n\r\nYa quedo eliminado esos links.\r\nPuedes verificarlo porfavor, si sigue apareciendo intenta recargar la página para ver los datos.\r\n\r\nSaludos', '19/04/2022 11:27 am', 'miriamc300@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(140, 'Baja de Usuarios del CRM y/o Correos', 'ASESOR ITSEL SORIA ', 'BAJA DE USUARIOS DEL ASESOR 503 ITZEL SORIA ', 'Adalberto Juarez Bonilla', 500, '19/04/2022 02:03 pm', 'Completado', 'Hola Adal\r\nBuenas tardes\r\nYa se ha dado de baja el usuario Itzel.\r\n¿Quieres que los clientes/prospectos que tenia se reasignen a ti?\r\n\r\nSaludos', '19/04/2022 02:07 pm', 'adalberto@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Super urgente'),
(141, 'Baja de Usuarios del CRM y/o Correos', 'baja', 'favor de dar de baja a David de mi equipo ya nunca ha entrado a su CRM ', 'Diana Dominguez Rodriguez', 100, '20/04/2022 05:25 pm', 'Completado', 'Hola buen dia\r\nYa se dio de baja David de su equipo, se eliminaron correo electronico institucional; usuario y contraseña del CRM.\r\nComo no tenia clientes registrados, no es necesario reasignar nada.\r\nSaludos', '21/04/2022 10:50 am', 'dianad@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Super urgente'),
(142, 'Error de Página', 'No tengo acceso a inmuebles 24 y vivaanuncios ', 'Estoy intentando entrar a inmuebles y viva anuncios desde mi CRM y me indica que el correo es incorrecto, no puedo publicar, anexo evidencia solo de una imagen ya que no me permite adjuntar más ', 'Tania Isabel Del Valle Ramirez  y Daniel Flores', 102, '21/04/2022 11:22 am', 'Completado', 'Hola buen dia. Tania\r\nLo pasare al area correspondiente, ¿Segura que estas colocando la contraseña correctamente?, no es la misma contraseña del CRM.\r\nSaludos', '21/04/2022 01:55 pm', 'tania.daniel102@agnorconsultores.com', 'evidencias/solicitudes/IMG-20220421-WA0051.jpg', 'evidencias/respuestas/', 'Alta'),
(143, 'Cambios/Actualización en datos Cliente, Cita, etc.', 'Cambio de fecha en cita', 'Favor de Cambiar el dia de la cita al sabado 23-04-2022 del cliente Antonio Reyes Montoya', 'Baltazar Alcantara Bustos', 800, '21/04/2022 11:48 am', 'Completado', 'Hola Balta\r\nYa quedo actualizado la fecha de la cita\r\nSaludos', '21/04/2022 01:59 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/baltacapcita23.JPG', 'Alta'),
(144, 'Baja de Usuarios del CRM y/o Correos', 'dar de baja usuario', 'Charly me apoyas a dar de baja los siguientes usuarios:\r\nIleana Mercedes 214\r\nJoana Yadira 210\r\nCarlos Susvilla 207\r\nBrenda Michelle 208\r\nAlejandra Martinez 202\r\nMuchas Gracias !!!!\r\n', 'Penelope  Carrera Becerra', 200, '22/04/2022 01:03 pm', 'Completado', 'Hola peni\r\nYa he recibido la solicitud, estare trabajando en ello.\r\nPero antes de terminar, los clientes si es que tienen registrados quieres que se te reasignen a ti?\r\no a alguien más?\r\nSaludos\r\nActualziación 05/05/2022\r\nYa quedaron eliminados los registros, correos y usuarios en CRM.\r\nSaludos', '05/05/2022 11:07 am', 'penelope@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Media'),
(145, 'Alta usuario CRM y/o Correo', 'Alta de usuario y contraseña', 'Favor de dar de alta en CRM a (Equipo Baltazar)\r\nRosa Elena Garcia Olvera\r\n5522530363\r\nFavor de generar usuario y contraseña\r\nCRM\r\nInmuebles24\r\nVivanuncios', 'Baltazar Alcantara Bustos', 800, '22/04/2022 01:36 pm', 'Completado', 'Hola Balta buenas tardes\r\nEl usuario seria rosaelena806 o rosaelenag806@agnorconsultores.com\r\nContraseña: Rosaelena#80663\r\nInmuebles24 usuario: rosaelenag806@agnorconsultores.com | contraseña: Rosaelena#80663\r\n\r\nYa esta su usuario disponible en CRM.\r\nSaludos', '22/04/2022 02:43 pm', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Super urgente'),
(146, 'Soluciones generales (Impresora, Correos)', 'Falla en el correo para ingresar al Drive', 'Falla en el correo para ingresar al Drive, no me da acceso con el correo institucional, me deja como predeterminado otro correo. adjunto pantallas de acceso. ', 'Francisco García Ramírez', 405, '26/04/2022 10:48 am', 'Completado', 'Hola Paco buen dia\r\nNo da acceso por que necesitas primero crear la cuenta empresarial. \r\nEn Google\r\nhttps://agnorconsultores.com/asesores/dashtuto.php?id=5\r\nPuedes ver este tutorial, para que te ayude a dar el alta, o contacta a tu Coordinador.\r\nSaludos', '26/04/2022 01:14 pm', 'franciscog405@agnorconsultores.com', 'evidencias/solicitudes/cuenta de agnor.docx', 'evidencias/respuestas/', 'Alta'),
(147, 'Error de Página', 'No logro entrar al drive', 'He estado intentando entrar al drive pero me sigue pidiendo permiso, ya intenté habilitar mi correo institucional nuevamente y no me lo permite gmail', 'Tania Isabel Del Valle Ramirez  y Daniel Flores', 102, '26/04/2022 02:23 pm', 'Completado', 'Hola buen dia\r\nNecesitas checar este asunto con el propietario de la carpeta en Drive, el cual es Jesus Romero.\r\nPuedes mandar un correo a : jromero@agnorconsultores.com o enviar un mensaje directo a Whatsapp.\r\nSaludos', '26/04/2022 03:11 pm', 'tania.daniel102@agnorconsultores.com', 'evidencias/solicitudes/Screenshot_20220426-142013.png', 'evidencias/respuestas/', 'Media'),
(148, 'Error de Página', 'NO Puedo agregar a mi nuevo cliente', 'Hice una cita para el dia miercoles a las 10.00am,pero no pude agregar a mi nuevo cliente porque la pagina me marca error,se agendo la cita con otro cliente,favor de checar ese detalle gracias.', 'Claudia  Sofia Moncada Tovar', 201, '02/05/2022 09:59 pm', 'Completado', 'Hola Sofi\r\nEste error se debía a que se verifica los dos teléfonos en el cliente,\r\nEsto se le explico a tu coordinador.\r\nYa se ha removido esta función, por lo que ya podras registrar tu cliente sin problema', '03/05/2022 09:21 pm', 'claudias201@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Alta'),
(149, 'Baja de Usuarios del CRM y/o Correos', 'Baja de asesor', 'Favor de dar de Baja en TODO a\r\nRosa Elena Garcia Olvera', 'Baltazar Alcantara Bustos', 800, '04/05/2022 12:51 pm', 'Completado', 'Hola balta buen día, si en unos momentos de daría de baja\r\nSaludos\r\n\r\nActualización: 05/05/2022\r\nYa quedo dada de baja del CRM y Correos\r\nSaludos', '05/05/2022 10:50 am', 'balcantara@agnorconsultores.com', 'evidencias/solicitudes/', 'evidencias/respuestas/', 'Alta');
INSERT INTO `tutoriales` (`id`, `titulo`, `descripcion`, `fecharegistro`) VALUES
(1, 'Como dar de alta un Usuario', 'Servira para saber como dar de alta un cliente de manera facil y exitosa.', '04/02/2022'),
(2, 'Como dar de alta una Cita', 'Servira para saber como dar de alta una cita de manera facil y exitosa.', '04/02/2022'),
(3, 'Proceso Legal AG NOR', 'Estatus y significado de cada proceso en tiempos de espera', '09/02/2022'),
(4, 'Dar de alta mis Registros de publicaciones (Links)', 'Se mostrára como registrar las publicaciones que has dado de alta en inmuebles y/o vivanuncios y alcanzar la meta de 60 publicaciones al mes.', '03/03/2022'),
(5, 'Dar de alta cuenta Gmail con correo institucional (@agnorconsultores.com)', 'Este tutorial te ayudara a crear y configurar tu cuenta de Gmail con el correo institucional, esto ayudara a tener los mismos servicios de Drive.\n', '11/03/2022'),
(6, 'Dar de alta un Ticket De ayuda', 'Este tutorial te ayudara a crear tickets de ayuda, para solicitar ayuda, mantenimiento, cambios, actualizaciones, etc. o de igual forma para sugerir cambios, reportar errores.', '15/03/2022'),
(7, 'Seguimiento a tu clientes/prospectos', 'Este tutorial te ayudara a dar un correcto seguimiento a tus clientes/prospectos, asi como tener toda la información a tu alcance, ayudate a saber mas de tu cliente, y asi dar la mejor presentación a el.', '16/03/2022'),
(8, 'Seguimiento a tus citas', 'Este tutorial te ayudara a dar un correcto seguimiento a tus citas y asi no tener pendientes, para identificar el por que de las cosas con tus clientes.', '17/03/2022'),
(9, 'Edición de clientes y Notificaciones por asignación', 'Este tutorial te ayudara a informarte sobre los campos y aspectos a tener en cuenta, al cambiar la información del prospecto, o al recibir un prospecto.', '17/03/2022');
